import React from "react";
import { Link } from "react-router-dom";

export const navbar = () => {
    return <nav>
        <Link to="/">Home</Link>
        <ul>
            <li>
                <Link to="/about">About</Link>
            </li>
            <li>
                <Link to="/info">Information</Link>
            </li>
        </ul>
    </nav>;
};
